import { Component } from "react";
import {MainContainer,MainHeading,LoginCard,ChangeButton} from  './styledComponent.js'
import ThemeContext from "../../context/ThemeContext.js";

class Login extends Component {
  render() {
    return (
      <ThemeContext.Consumer>
      {
       value=>{
         const {blacktheme,changeTheme}=value ;
         const onClickChangetheme=()=>{
          changeTheme();
         } 
         return (
           <MainContainer theme={blacktheme}>
             <LoginCard>
               <MainHeading>Hello welcome</MainHeading>
             </LoginCard>
             <ChangeButton onClick={onClickChangetheme}>Change theme</ChangeButton>
           </MainContainer>
         );
       }
      }
     </ThemeContext.Consumer>
    )

  }
  }
  export default Login
